import React from "react";
import "./index.css";
import roosterLogo from "../../assets/coq_2022-02-02/coq.png";
import Products from "../Products";

export default function Banner(props) {
  return (
    <>
      <div className="background">
        <div className="groupItems">
          <span className="titleSelection">{props.titleSelection}</span>
          <div id="exclusivity">{props.exclusivity}</div>
          <div className="buttonBanner">Voir tout</div>
        </div>
        <img src={roosterLogo} className="roosterLogo" />
      </div>
    </>
  );
}
